import React from 'react';
import Navbar from './components/Navbar';
import Button from './components/Button';

function App() {
  const handleClick = () => {
    alert('Bouton cliqué!');
  };

  return (
    <div className="App">
      <Navbar />
      <h1>Bienvenue sur LoveTogether</h1>
      <Button label="Cliquez-moi" onClick={handleClick} />
    </div>
  );
}

export default App;
